import React from 'react';

const Subheader = () => {
    return (
        <div className='bg-[#F3F3F3] pl-28 pr-28 h-[88px] flex items-center justify-start'>
            <div className='text-[#868686]'>
                <span >New In</span>
                <span>Football</span>
                <span>Basketball</span>
                <span>Badminton</span>
                <span>Rugby</span>
                <span>Tennis</span>
                <span>Hockey</span>
                <span>Lifestyle</span>
                <span>American Football</span>
                <span>Sales</span>
            </div>
        </div>
    );
};

export default Subheader;
